sys_variable_value.value:
(function execute(inputs, outputs) {
 var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "snapshot"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "snapshot"]);
})(inputs, outputs);

